import axios from 'axios';
const postOrder = async (data = {}) => {
  const url = "http://localhost:8080/order";
  if (data === {})
    return "No se pudo enviar la orden"
  const res = await axios.post(url, data)
  const plate = res.data
  return plate
};

export default postOrder;
